import React from "react";

import "./ExpensesFilter.css";

const ExpensesFilter = () => {
  const year1Handler = () => {
    console.log(2022);
  };
  const year2Handler = () => {
    console.log(2021);
  };
  const year3Handler = () => {
    console.log(2020);
  };
  const year4Handler = () => {
    console.log("2019");
  };
  return (
    <div className="expenses-filter">
      <div className="expenses-filter__control">
        <label>Filter by year</label>
        <select>
          <option value="2022" onClick={year1Handler}>
            2022
          </option>
          <option value="2021" onClick={year2Handler}>
            2021
          </option>
          <option value="2020" onClick={year3Handler}>
            2020
          </option>
          <option value="2019" onClick={year4Handler}>
            2019
          </option>
        </select>
      </div>
    </div>
  );
};

export default ExpensesFilter;
